import React, {useContext, useEffect, useState} from 'react'
import {PaymentContext} from '../../Context/PaymentContext'
import Logo from '../../Assets/logo.svg'
import '../Header/Header.css'


 const Header = () => {
    const {darkMode} = useContext(PaymentContext)
    const [darkModeStyle, setDarkModeStyle] = useState({
        headerStyles: 'global_container'
    })


useEffect(()=>{
    if(darkMode >= 1800 || darkMode <= 600){
        setDarkModeStyle({
            headerStyles: 'global_container_dark'
        })
    }
}, [])
    return (
        <div id='header'>
            <div className='header_containers'></div>
            <div className='logo'>
                <img id='logo_img' src={Logo} alt='logo'></img>
            </div>
            <div className='header_containers'>

                <div id='hamburger_container'>
                <div className='hamburger_menu'></div>
                <div className='hamburger_menu'></div>
                <div className='hamburger_menu'></div>
                </div>

            </div>

        </div>
    )
}
export default Header;
